import './App.css';
import Login from './components/Login'
import { Router, Routes, Route } from 'react-router-dom'



function App() {
  return (
    <div className="App">


      <Router>
        <Routes>
          <Route path="/login" element={<Login />} />
        </Routes>
      </Router>



    </div>
  );
}

export default App;
